import './Content.css'
import img from './ham.png'

function Content() {

    const { id, heading, para } = props;

    return(
        <section className="content">
            <article className="article">
                <img src={img} ></img>
                <div className="text">
                    <h1>{heading}</h1>
                    <p>{para}</p>
                </div>
            </article>
        </section>
    );
}

export default Content;
